import React from "react";
import { NavLink } from "react-router-dom";
import classes from "./Blogmainpage.module.css";
const Blogmainpage = () => {
  return (
    <React.Fragment>
      <div className={classes.read}>
        <Navbar />
        <img src="/assets/CloudComputing.jpg"></img>
      </div>
    </React.Fragment>
  );
};
export default Blogmainpage;
